import * as React from "react";
import { Redirect } from 'react-router-dom';
import gql from "graphql-tag";
import { useQuery, useMutation, useLazyQuery, useApolloClient } from "@apollo/react-hooks";
// Query String
const queryString = require('query-string');
// GraphQL 
const LOGIN_USER = gql`
  mutation login($Email: String!) {
    login(Email:$Email)
  }
`;
const REGISTER_USER = gql`
  mutation register($Email: String!) {
    register(Email:$Email)
  }
`;
const VERIFY_USER = gql`
  query verify($Token:String!) {
    verify(Token:$Token) {
      user {
        _id
        email
      }
      token
    }
  }
`;

//
// Function
//

const DeckSettings: React.FunctionComponent<{}> = () => {
  // Params
  const parsed = queryString.parse(location.search);
  const verifyToken = parsed.token;
  // Set States
  const [login, setLogin] = React.useState("");
  const [register, setRegister] = React.useState("");
  const [loginPrompt, setLoginPrompt] = React.useState("");
  const [registerPrompt, setRegisterPrompt] = React.useState("");
  const [redirectHome, setRedirectHome] = React.useState(false);
  // GraphQL - M's
  const [ callLogin, { loading:loginMutationLoading, error:loginMutationError }] = useMutation(LOGIN_USER);
  const [ callRegister, { loading:registerMutationLoading, error:registerMutationError }] = useMutation(REGISTER_USER);
  // GraphQL - Q's
  const [ callVerify, { loading:verifyLoading, data:verifyData, error:verifyError }] = useLazyQuery(VERIFY_USER, {
    fetchPolicy: "no-cache"
  });

  //
  // Use Effect
  //

  React.useEffect(() => {
    if(verifyToken) {
      if(verifyError && !verifyLoading) {
        console.log(`Error ${verifyError}`);
      }
      if(!verifyData) {
        callVerify({variables:{ Token:verifyToken }});
      } else {
        window.localStorage.setItem("user", JSON.stringify(verifyData.verify.user));
        window.localStorage.setItem("token", "Bearer "+verifyData.verify.token);
        const client = useApolloClient();
        client.writeData({ data: { isLoggedIn:true }});
        setRedirectHome(true);
      }
    }
  },[verifyLoading, verifyData, verifyToken]);

  //
  // Login
  //

  const submitLogin = async () => {
    event.preventDefault();
    try {
      const res = await callLogin({ variables: { Email:login }});
      if(res.data.login) {
        setLoginPrompt("Success - Please check your emails.")
      }
    } catch(err) {
      console.log(`Login Error (`+err+`)`)
    }
  }

  //
  // Register
  //

  const submitRegister = async () => {
    event.preventDefault();
    try {
      const res = await callRegister({ variables: { Email:register }});
      if(res.data.register) {
        setRegisterPrompt("Success - Please check your emails.")
      }
    } catch(err) {
      console.log(`Register Error (`+err+`)`)
    }
  }

  // Return
  return (
    <>      

    </>
  );
};

export default DeckSettings
